package corejava.superkeyword;

public class Main {
	static int babu(int a, int b) {
		return a+b;
	}
	static float babu(float fname) {
		return fname;
	}
	static double babu(double n) {
		return n;
	}
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int z=babu(2,5);
		float fname=babu(3);
		double n= babu(38);
		System.out.println(z);
		System.out.println(fname);
		System.out.println(n);
		
	}

}
